            counter : 0
        }
        this.increment = this.increment.bind(this);
    }
    render(){
        return (
            <div className="counter">
            <CounterButton by={1}/>
            <CounterButton by={5}/>
            <CounterButton by={10}/>
          </div>
        )
    }
